import About from "./About"

function App() {
    return (
      <>
      <Navbar></Navbar>
      <Suspense fallback={<Loader />}>
      <Routes>
      <Route exact path="/About ">
        <ProjectOverview />
      </Route>
      </Routes>
      </Suspense>
      </>
    );
  }
